- DT 88m2, mt 6m;
- Nhà thô;
- Xây dựng 4 tầng;
- Ngay gần khu chung cư Handico;
- Làm văn phòng hay kinh doanh các mặt hàng đều được;
- Sổ đỏ đầy đủ sang tên;
- Giá 18 tỷ (có thương lượng)
LH em Huyền để xem 24/7
